import gql from "graphql-tag";

/**
 * GraphQL categories and products query.
 */
const MEDIA_LIST = gql`query {
  products {
    nodes {
      image {
        id
        slug
        sourceUrl
      }
    }
  }
}`;
export default MEDIA_LIST;
